import {ref,onMounted} from 'vue'
const progess = ref()
const text = ref()
onMounted(()=>{
    const  rotateCircle =(persent:number) =>{
    const circleLength = Math.floor(2 * Math.PI *parseFloat(progess.value.getAttribute("r")) )
    const val = persent*circleLength/100;
    const red = 255+parseInt((0-255)/100*persent);
    const green =  0+ parseInt((191-0)/100*persent);
    const blue = 0+ parseInt((255-0)/100*persent);
    progess.value.setAttribute("stroke-dasharray",val +",10000");
    progess.value.setAttribute("stroke",`rgb(${red},${green},${blue})`);
    text.value.innerHTML = persent+'%';
    text.value.setAttribute("fill",`rgb(${red},${green},${blue})`)
}
let num = 0
setInterval(()=>{
    num++;
    if(num>100){
        num=0;
    }
